import * as axios from "axios";

const instance = axios.create({
    baseURL: 'https://my-json-server.typicode.com/RaySkelen/demo/db',
    withCredentials: true,
    headers: {}
})

export const dataAPI = {
    getData() {
        return instance.get().then(response => {return console.log(response)})
    }
}
